// src/pages/DailyChallenge/DailyChallenge.js
import React from "react";
import { Link } from "react-router-dom";

const DailyChallenge = () => {
  return (
    <div style={styles.container}>
      <h2>Daily Challenge</h2>
      <p>Complete your daily workout to gain XP and improve your fitness.</p>
      <Link to="/live-workout" style={styles.startButton}>
        Start Workout
      </Link>
    </div>
  );
};

const styles = {
  container: {
    maxWidth: "600px",
    margin: "40px auto",
    padding: "20px",
    textAlign: "center",
  },
  startButton: {
    marginTop: "20px",
    display: "inline-block",
    padding: "12px 25px",
    backgroundColor: "#28a745",
    color: "white",
    borderRadius: "6px",
    textDecoration: "none",
    fontWeight: "600",
  },
};

export default DailyChallenge;
